import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const FAQSection = () => {
  const [openFAQ, setOpenFAQ] = useState(null);

  const faqs = [
    {
      id: 1,
      question: "What services does Skygate Group provide?",
      answer: "Skygate Group offers comprehensive logistics and travel solutions through two specialized divisions. Skygate Logistics provides freight forwarding from the United States and China, warehousing & distribution, supply chain management, and last-mile delivery. Skygate Travel handles corporate travel management, leisure travel planning, group travel coordination, and 24/7 travel support. We also specialize in healthcare coordination and international education guidance.",
      category: "general",
      icon: (
        <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
        </svg>
      )
    },
    {
      id: 2,
      question: "How long has Skygate Group been in business?",
      answer: "Skygate Group was founded in 2018, but our team has been providing logistics and travel services since 2009. With over 7 years of combined experience, we have built a strong reputation for reliability, innovation, and exceptional customer service across multiple industries.",
      category: "general",
      icon: (
